Information
------------------------------

Man vs. YouTube
Ever wonder how your favorite YouTube videos are made? Turns out, there's more science behind viral video stunts than you may expect. Some are real, a lot are fake - and it's difficult for the average person to know which is which. Welcome to the world of Man vs. YouTube, where engineer Tim Shaw and professional daredevil Johnny Riche attempt to recreate the web's most mind-boggling moves. Shaw and Riche tackle some of the web's most viral gems, from Russian kids riding fire extinguishers to Saudi &quot;sandal skating&quot; to the improbable feat of sprinting across water. If it's not fake, it's fair game for the team, who tackle the science behind the hair-raising stunts before attempting them - sans special effects. It's up to Shaw and Riche to separate fact from fiction, and break some laws of physics in the process.
On Man vs. YouTube, humans are pitted against the powers of the Internet for a battle of URL versus IRL. Can Shaw and Riche use their brains and brawn to beat the web at its own game?

